import classes from './InvestmentsTable.module.css';

export default function InvestmentTable(props) {

  const defaultMessage = 'No Investments to show';

  const tableContent = props.data.map(investment => {
    return (
      <tr>
        <td>{investment.year}</td>
        <td>{investment.savingsEndOfYear}</td>
        <td>{investment.yearlyInterest}</td>
        <td>{investment.yearlyContribution}</td>
      </tr>
    );
  });

  return (
    <table className={classes.result}>
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      <tbody>
        {defaultMessage}
      </tbody>
    </table>
  );
}
